import Items from './Items';
import './App.css';
import Item from './Item';


function App() {

  return (
    <div className="App">

       <table id="menu">

{Items.map(function(NewItem){
  return (
    <Item 
    key= {NewItem.key}
    img= {NewItem.img}
    name= {NewItem.name}
    price={NewItem.price}
    />
  )
})}
</table>
    </div>
  );
}

export default App;
